import React from "react";
import Card from "./Card";

const CardList = ({robots}) =>{
  const CardArray = robots.map((user, i)=>{
    return <Card key={0} name={robots[0].name} email={robots[0].email} id={robots[0].id}/>
  })
  return(
    <div>
      <CardArray />
    </div>
  )
}

export default CardList;
